import React from "react";
import array from './Api';
import CustomizedAccordions from './Li';
import './index.css';
import Api from './Api';

const App = () =>{
    return (
        <>
        <div className="main-div">
            <div className="centre-div">
                <h1>Accordion</h1>
                {/* <CustomizedAccordions /> */}
                <h2>
                  {Api.map((val) =>{
                      return <h2> {val.ques} </h2>
                  })}
                </h2>
        </div>
        </div>
        </>
    ) ;
}

export default App;
